(107, 'Hướng dẫn sử dụng Mchose GX8713', 'huong-dan-su-dung-mchose-gx8713', '<p>Nihao! <a href=\"https://kicap.vn/mchosegx87-ban-phim-co-khung-nhom-tkl-3-mode-co-ta\">Mchose GX87</a> là một trong những chiếc bàn phím ngon ở phân khúc. Với thiết kế layout TKL, đèn nền RGB, 3 chế độ,.... Mchose GX87 chắc chắn sẽ làm người dùng thấy thỏa mãn khi sử dụng. KICAP rất hân hạnh được đồng hành cùng Mchose mang tới sản phẩm này tới tay người dùng.</p><p>Hãng cũng cung cấp một quyển sổ hướng dẫn sử dụng chi tiết với rất nhiều thứ tiếng. Tuy nhiên để tiện theo dõi và sử dụng, KICAP sẽ tóm tắt lại những tip sử dụng chính cho mọi người dễ hiểu.</p><p>&nbsp;</p><blockquote><strong>Tuyên bố trách nhiệm</strong>: <em>Bài viết này chỉ hướng dẫn cho anh em cách sử dụng bàn phím. KICAP chỉ tiếp nhận và giải đáp những thắc mắc về lỗi bàn phím khi mọi người mua bàn phím bên shop KICAP</em><em>Tất cả các sản phẩm mua ở bên cửa hàng khác quý khách vui lòng liên hệ trực tiếp với họ để được phục vụ.</em><em>Các đơn hàng quý khách mua trên sàn tmđt như shopee, lazada, tiktok vui lòng inbox trực tiếp cho gian hàng tránh liên hệ nhầm cửa hàng nhé!</em><em>Trân trọng cảm ơn anh em &lt;3</em></blockquote><p>&nbsp;</p><p><strong><em>I. Cài đặt phần mềm, driver&nbsp;</em></strong></p><p><strong>Link tải phần mềm cho window: </strong><a href=\"https://1drv.ms/u/c/4369e28698355db0/EZBb70DA8UFBv_APRsACIicB1Uh0r2Czl0RxLEFVecrlfg?e=Owft5Q\"><strong><em>Mchoose Hub</em></strong></a></p><p>Sau khi tải phần mềm, các bạn kết nối bàn phím với máy tính qua dây cáp USB của hãng cung cấp (không kết nối bằng bluetooth hoặc wireless 2.4). Sau đó, bật phần mềm lên và thực hiện chỉnh LED cũng như keymap theo nhu cầu sử dụng của cá nhân. Trong trường hợp có phiên bản firmware mới thì các bạn cần đảm bảo kết nối dây USB ổn định thì mới cập nhật.</p><p><strong><em>II. Điều chỉnh chế độ kết nối với các thiết bị</em></strong></p><p><strong>Kết nối Bluetooth (gạt công tắc ở mặt dưới bàn phím sang B):</strong></p><p><stro